(25, 1, '2020-10-15 20:22:58', '2020-10-15 20:22:58', 'The Dutch masters of horror are back! On âFranckensteina Strataemontanusâ, CARACH ANGREN resurrect the gruesome story of troubled soul âConrad Dippelâ; the inspiration of Mary Shellyâs novel âFrankensteinâ.\r\n\r\nCARACH ANGREN set out to tell ghost-stories with a set of paranormal cases recorded on the demo âThe Chase Vault Tragedyâ (2004). This was soon followed by the official release of the âEthereal Veiled Existenceâ EP (2005) as a prelude to the haunting âLammendamâ (2008). Their full-length âDeath Came through a Phantom Shipâ (2010) witnessed the band setting sail to bring their eccentric and capturing live performances to audiences and festivals all over Europe. In the wake of third album âWhere the Corpses Sink Foreverâ (2012), the haunting had reached the US and started to spread rapidly. While firmly remaining in the horror genre, their tales revolve around the evils of war. This mature streak was taken a step further with the fourth full-length âThis Is No Fairytaleâ (2015), which is on the surface a darker variation of the âHansel and Gretelâ, but also deals with a dysfunctional family. With âDance And Laugh Amongst The Rottenâ (2017), the band returned to pure story telling that centred on a girl playing a little too long with a Ouija board.\r\n\r\nCARACH ANGREN return with the monster âFranckensteina Strataemontanusâ, where the Dutch have pushed their unashamedly theatrical style to new heights. Press play and have your soul transferred with this new elixir of life!', 'Carach Angren', '', 'publish', 'closed', 'closed', '', 'carach-angren', '', '', '2020-10-15 20:22:58', '2020-10-15 20:22:58', '', 0, 'http://localhost/wordpress/?post_type=home&#038;p=25', 3, 'home', '', 0),
